import GetWolluView from './GetWolluView';
import ShowWolluAmountView from './ShowWolluAmountView';

function Wollu() {
  return (
    <div className='WalluBackground'>
      <MainView/>
      <GetSalaryView/>
      <GetWolluView/>
      <ShowWolluAmountView/>
    </div>
  );
}
